INSERT INTO `questions_bot` (`id`, `case_id`, `quick_result_id`, `order`, `question_awswers`, `status`) VALUES
	(1, 1, 0, 1, 'Primero dime, ¿quién dice que las cosas deberían de ser así como tú las piensas? ¿Quién o qué define el estándar de que las cosas deberían o no deberían de ser de tal manera?', 1),
	(2, 1, 0, 2, 'Ahora me gustaría preguntarte, ¿cómo sabes que cualquier otra alternativa tendría malos resultados o estaría mal? ¿Qué tan grave puede ser que exista otra alternativa? ', 1),
	(3, 1, 0, 3, 'Supongamos que, enfrente de ti, hay una persona que tiene el mismo pensamiento exigente que tú y tu papel es jugar al abogado del diablo. Tu trabajo es hacerle ver el otro lado de la moneda, ¿qué le dirías? ¿Cómo le harías ver que esa no es la única forma de pensar y que hay otras alternativas?', 1),
	(5, 1, 0, 4, 'Ahora quiero que cambies el &#34;debería&#34; por un &#34;me gustaría&#34;. \\n Describe cómo cambia tu perspectiva de la situación...', 1),
	(6, 1, 0, 5, 'Buenísimo. Sé que no es fácil debatir con tu propia mente, pero lo hiciste muy bien \\n Realmente espero que este ejercicio te haya ayudado', 1),
	(7, 1, 1, 6, '¡Perfecto! Aquí estaré si me necesitas.', 1),
	(8, 1, 3, 6, 'No te preocupes, cuando gustes podemos intentar nuevamente', 1),
	(9, 1, 2, 6, '¿Quieres que empecemos de nuevo?', 1);
